import React from "react";

function Dashboard() {
  return (
    <div className="container-fluid d-flex align-items-start" style={{ height: '100vh', backgroundColor: '#3d3c3c' }}>
      <div className="row">
        <div className="col col-sm-3">
          <nav className="nav flex-column">
            <button className="btn nav-link mt-3" style={{ backgroundColor: '#9C9C9C' }}>Villes</button>
            <button className="btn nav-link mt-3" style={{ backgroundColor: '#9C9C9C' }}>Zones</button>
            <button className="btn nav-link mt-3" style={{ backgroundColor: '#9C9C9C' }}>Restaurants</button>
            <button className="btn nav-link mt-3" style={{ backgroundColor: '#9C9C9C' }}>Utilisateurs</button>
          </nav>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
